	@Test
	@Order(1)
	void join() throws Exception {
		UsersDto user = new UsersDto();
		user.setEmail("temp");
		usersController.checkEmail(user.getEmail());
		user.setPassword("1234");
		user.setNickname("");
		user.setEmoteColorIdx(1);
		user.setSocialId("@mindder");
		user.setFindTag(unicodeKorean.KtoE(user.getNickname()));
		usersController.join(user);
	}

	@Test
	@Order(2)
	void userTest() throws Exception {
		// 
		UsersDto user = new UsersDto();
		user.setEmail("temp");
		user.setPassword("1234");

		Map<String, String> loginUser = (Map<String, String>) usersController.login(user).getData();
		assertNotNull(loginUser);
		System.out.println(loginUser);

		//   

		//   
		FileDto fileDto = new FileDto();
		fileDto.setBase64(testBase64);
		fileDto.setExtension("gif");
		fileDto.setOriginalFile("123.gif");
		int fileidx = (int) fileController.fileUpLoad(fileDto).getData();
		//   

		user = new UsersDto();
		user.setNickname("4");
		user.setEmoteColorIdx(5);
		user.setFileIdx(fileidx);
		user.setFindTag(unicodeKorean.KtoE(user.getNickname()));
		String accessToken = loginUser.get("accessToken");
		assertNotNull(usersController.updateUser(accessToken, user));

		//  
		user = new UsersDto();
		user.setPassword("1111");
		assertEquals(usersController.changePassword(accessToken, user).getMessage(), "  ");

		//    
		user = new UsersDto();
		user.setPassword("1111");
		assertEquals(usersController.findpassword(accessToken, user).getMessage(), "     ");

		// 
		assertEquals(usersController.logout(accessToken).getMessage(), "  ");


	}

	@Test
	@Order(3)
	void mainFeedTest() throws Exception {

		// 
		UsersDto user = new UsersDto();
		user.setEmail("temp");
		user.setPassword("1111");

		Map<String, String> loginUser = (Map<String, String>) usersController.login(user).getData();
		assertNotNull(loginUser);
		System.out.println(loginUser);
		String accessToken = loginUser.get("accessToken");

		//   
		FileDto fileDto = new FileDto();
		fileDto.setBase64(testBase64);
		fileDto.setExtension("gif");
		fileDto.setOriginalFile("123.gif");
		int fileidx = (int) fileController.fileUpLoad(fileDto).getData();
		
		//  
		FeedsDto feedsDto = new FeedsDto();
		feedsDto.setMainText("1  .");
		feedsDto.setEmoteColorIdx(1);
		feedsDto.setEmoteIdx(1);
		feedsDto.setNormalTag("#");
		feedsDto.setPublic(true);
		feedsDto.setFileIdx(fileidx);
		assertNotNull(feedsController.writeFeeds(feedsDto, accessToken).getMessage(), "   !");

		//  
		FeedsUpdateDto feedsUpdate = new FeedsUpdateDto();
		feedsUpdate = new FeedsUpdateDto();
		feedsUpdate.setNormalTag("##");
		feedsUpdate.setMainText("2  ");
		feedsUpdate.setPublic(false);
		assertNotNull(feedsController.modifyFeed(accessToken, feedsUpdate).getMessage(), "   !");

		//  
		int feedIdx = 7;
		assertNotNull(feedsController.deleteFeed(accessToken, feedIdx).getMessage(), "   !");

		//   
		assertNotNull(feedsController.deleteFeed(accessToken, feedIdx).getMessage(), "   !");

		//  ->    (3)
		assertNotNull(feedsController.recommendation(accessToken).getMessage(), "     !");

		//     
		assertNotNull(feedsController.neighborFeed(accessToken, 1).getMessage(), "    !");

		//     
		assertNotNull(feedsController.popularFeed(accessToken, 1).getMessage(), "     !");

		//     
		assertNotNull(feedsController.realtimeFeed(accessToken, 1).getMessage(), "    !");

		//  
		assertNotNull(feedsController.crawling("pink").getMessage(), "  !");

	}

